import React,{useEffect,useState} from "react";
import { Link, NavLink } from "react-router-dom";

import {
    Button,
    Card, CardBody,
    Form, FormGroup, FormFeedback,
    Input,
    Alert,
    Container,
} from "reactstrap";
import '../style.css'
class SignIn extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            email: '',
            password: '',
            submitted: false,
            loading: false,
            error: ''
        };
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        
    }

    handleSubmit(event) {
       
    }

    render() {
        
        return (
            <React.Fragment >
                <Container className="width-percent-80 SignIn-card">
                    {this.state.error &&
                        <Alert color="danger" className="p-2 SignIn-alert" >{error}</Alert>
                    }
                    <Container className="px-0">
                        <Card className="SignIn-form">
                            <CardBody className="px-0 pt-0 pb-0">
                                <div className={window.innerWidth >= 415 && window.innerWidth <= 1920 ? "mx-4 mt-5" : "m-2"}>
                                    <div className="text-center">
                                       
                                    </div>
                                    <h1 className={window.innerWidth >= 415 && window.innerWidth <= 1920 ?
                                         "text-center SignIn-text font-weight-bold SignIn-font-size__text pb-3" :
                                          "SignIn-text font-weight-bold text-center"}>
                                              Đồ Án
                                    </h1>
                                    <Form onSubmit={this.handleSubmit}>
                                        <FormGroup className={window.innerWidth >= 415 && window.innerWidth <= 1920 ? "pb-3" : ""}>
                                            <Input
                                                bsSize="mb-3"
                                                name="username"
                                                onChange={this.handleChange}
                                                placeholder="Username"
                                                invalid={ false }
                                            />
                                            <FormFeedback valid>
                                                Username is a required field!
                                            </FormFeedback>
                                        </FormGroup>
                                        <FormGroup className={window.innerWidth >= 415 && window.innerWidth <= 1920 ? "pb-3" : ""}>
                                            <Input
                                                bsSize="mb-3"
                                                type="password"
                                                name="password"
                                                value={this.state.password}
                                                onChange={this.handleChange}
                                                placeholder={"Password"}
                                                invalid={false}
                                            />
                                            <FormFeedback invalid>
                                                Passwords is a required field!
                                            </FormFeedback>
                                            <small className={window.innerWidth >= 415 && window.innerWidth <= 1920 ? "py-3" : ""}>
                                                {/* <Link to="/auth/reset-password">Quên mật khẩu</Link> */}
                                                Quên mật khẩu
                                            </small>
                                        </FormGroup>
                                        <div className="text-center mt-3">
                                            { true ?
                                                <Button
                                                    color="primary"
                                                    font-weight="200"
                                                    size="mb-3"
                                                    className="btn btn-block text-capitalize"
                                                >
                                                    Đăng Nhập
                                                </Button>
                                                :
                                                <LoadingSprinner />
                                            }
                                        </div>
                                    </Form>
                                    <div className={window.innerWidth >= 411 && window.innerWidth <= 414 ? "text-center mt-3" : window.innerWidth >= 415 && window.innerWidth <= 1920 ? "text-center mt-2 pt-3" : "text-center mt-2"}>
                                        {/* <NavLink to="/auth/sign-up">{'HAVE_NOT_ACCOUNT'}</NavLink> */}
                                        <p>
                                            Do not have an account. Signup?
                                        </p>
                                    </div>
                                </div>
                            </CardBody>
                        </Card>
                    </Container>
                </Container>
            </React.Fragment>

        );
    }
}


export default SignIn
